const animals = [
    {
        name:"cat",
        color:"white",
        foodrequirements:{
            food:2,
            milk:3
        }
    },
    {
        name:"dog",
        color:"black",
        foodrequirements:{
            food:4,
            milk:5
        }
    }
];
export default animals;
